class BtnCo extends React.Component {

render(){
return(
    <div class="nav">
    <ul>
        <li><button class="boutonco" style="vertical-align:middle" onclick="btnClick()"><span>Se connecter</span>
        </button></li>
    </ul>
</div>
)

}
}

export default BtnCo;
